  false,\n\t\"url\": null,\n\t\"notes\": \"EX1203 of NOAA Ship Okeanos Explorer (EX)
  will run its Kongsberg EM302 multibeam sonar survey system 24 hours per day with
  periodic XBT casts for calibration. One to three CTD casts are planned. The EM302
  produces bathymetric, bottom backscatter, and water column backscatter data, At
  two targeted survey sites, the EM302, the Knudsen CHIRP 3260 sub-bottom profiler,
  and the Simrad EK60 single beam sonar sensor will be employed.\",\n\t\"owner_org\":
